  Map<String,String> versions=(Map<String,String>)metadata.get("versions");
  Map<String,String> urls=(Map<String,String>)metadata.get("urls");
  Assert.assertFalse(versions.isEmpty());
  Assert.assertFalse(urls.isEmpty());
